class Solution:
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        counter = len(p)
        start = 0
        result = list()

        chars = self.redoDict(p)

        i = 0
        while i < len(s):
            c = s[i]
            # print(s[i])
            if s[i] in chars.keys():
                if sum(chars.values()) == counter:
                    start = i
                if chars[s[i]] > 0:
                    chars[s[i]] -= 1
                else:
                    chars = self.redoDict(p)
                    i = start
                    start = i
                if sum(chars.values()) == 0:
                    result.append(start)
                    chars = self.redoDict(p)
                    i = start
                # print(chars)
            else:
                start = i + 1
            i += 1

        print(result)
        return result

    def redoDict(self, p):
        chars = {}
        for c in p:
            if c not in chars.keys():
                chars[c] = 1
            else:
                chars[c] += 1
        return chars


